import React, { useEffect } from "react";

const LandingPage = () => {


  return (
    <div className="min-h-screen">
      <div className="text-center">
        <h1 className="text-4xl font-extrabold bg-gradient-to-r from-amber-200 via-yellow-400 to-amber-300 bg-clip-text text-transparent drop-shadow-sm mb-6">
          AI-Powered Streak Counter
        </h1>
        <h1 className="text-4xl font-extrabold bg-gradient-to-r from-amber-200 via-yellow-400 to-amber-300 bg-clip-text text-transparent drop-shadow-sm mb-6">
          ⚡Streak⚡
        </h1>


        <p className="text-xl bg-gradient-to-r from-amber-400 via-yellow-900 to-amber-400 bg-clip-text text-transparent">
          Click to streak. Get inspired. Stay healthy. See your progress.
        </p>
      </div>
    </div>
  );
};


export default LandingPage;
